import {
  createElement,
  loadAirwallex,
  ElementType
} from 'airwallex-payment-elements';

const intent_id = 'int_3l3nkfuMzVUBtVcgzAekaYsGYa';
const client_secret = 'eyJhbGciOiJIUzI1NiJ9.eyJpYXQiOjE2MDkzODQ1MDEsImV4cCI6MTYwOTM4ODEwMSwiYWNjb3VudF9pZCI6IjZkMzljOGU3LWQyY2EtNGQ0Yy04N2I5LWIzY2Y3MzNkNTU2ZSIsImRhdGFfY2VudGVyX3JlZ2lvbiI6IlVLIiwiaW50ZW50X2lkIjoiaW50XzNsM25rZnVNelZVQnRWY2d6QWVrYVlzR1lhIn0.UJ7OAvJ7hVCiMaZgCQW-GjPeIx-NAjp5ZOQotsG-JSc';
const ELEMENT_TYPE: ElementType = 'dropIn';

export async function getStatProps() {
  console.log('getting props');
  await loadAirwallex({
    env: 'staging'
  })
  await createElement(ELEMENT_TYPE, {
    intent: {
      id: intent_id,
      client_secret: client_secret
    }
  })?.mount(ELEMENT_TYPE);

  const onSuccess = (event: CustomEvent) => {
    /*
      ... Handle event
    */
    console.log(`Confirm success with ${JSON.stringify(event.detail)}`);
  };

  window.addEventListener('onSuccess', onSuccess as EventListener);
  return () => {
    window.removeEventListener('onSuccess', onSuccess as EventListener);
  };

  return {
    props: {}
  }
}

function dropin() {
  return (
    <div>
      <h2>DropIn Integration</h2>
      <div id={ELEMENT_TYPE}></div>
    </div>
  )
}

export default dropin;
